  false,\n\t\"url\": null,\n\t\"notes\": \"Datasets used in the analysis of the Colorado
  Plateau (COP) Rapid Ecoregion Assessment (REA).They can be downloaded via a layer
  package (lpk, similar to a zip file and contains layer files) that can be used in
  ESRI software. The Colorado Plateau REA has been peer reviewed. The Colorado Plateau
  ecoregion is located Utah and Colorado with extensions in New Mexico and Arizona.
  It has an area of 32,387 square miles and includes all or portions of 16 BLM field
  offices.  The Colorado Plateau is an uplifted, eroded, and deeply dissected tableland.
  Its benches, mesas, buttes, salt valleys, cliffs, and canyons are formed in and
  underlain by thick layers of sedimentary rock. The ecoregion has a broad latitudinal
  range, from the Uinta Basin in the north to the arid canyonlands along the border
  of Arizona and New Mexico.r\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
